def define_model(sized):#, batch_normalization):
    '''
    This function defines different models and returns the model and name of the subdirectory
    '''
    print("-------\nRunning functional API!\n")
    init="glorot_uniform"
    activation_function='relu'
    model = Sequential()
    model.add(Dense(50, activation='relu', input_shape=(sized,)))
    model.add(Dense(20, activation='relu'))
    model.add(Dense(1,activation="sigmoid"))
    opt = SGD(learning_rate=0.01, momentum=0.9)
    model.compile(optimizer="adam",loss='binary_crossentropy',metrics=['accuracy'])

    return model


# plot diagnostic learning curves
def summarize_diagnostics(history):

    # plot loss
    pyplot.subplot(211)
    pyplot.plot(history.history['loss'], color='blue', label='train')
    pyplot.plot(history.history['val_loss'], color='orange', label='test')
    pyplot.grid(color = 'grey', linestyle = '--', linewidth = 0.3)
    pyplot.ylabel('Cross Entropy Loss') 
    pyplot.legend()

    # plot accuracy
    pyplot.subplot(212)
    pyplot.plot(history.history['accuracy'], color='blue', label='train')
    pyplot.plot(history.history['val_accuracy'], color='orange', label='test')
    pyplot.grid(color = 'grey', linestyle = '--', linewidth = 0.3)
    pyplot.ylabel('Classification Accuracy') 
    pyplot.legend()

    # save plot to file
    filename = sys.argv[0].split('/')[-1]
    pyplot.savefig(filename + '_plot.png')

    pyplot.show()
    pyplot.close()

#Data creation
def Data_creation(sizextr,sizex,E,At):

    #E is the vector of measurements for users
    #At is the vector of measurements for Attacker

    Y_out=[] #Output array
    Final=[] #Input array
    Mean=[]  #Temporary array of Means depending on mu

    #Combines E and At into Final (X input) and Y_out (Y output) vectors
    for i in range(len(E)):
        print([int(numeric_string) for numeric_string in E[i]])
        E[i] = [int(numeric_string) for numeric_string in E[i]]
        Final.append(E[i])
        Y_out.append([1]) #1 is user
        #At
    for i in range(len(At)):
        At[i] = [int(numeric_string) for numeric_string in At[i]]
        Final.append(At[i])
        Y_out.append([0]) #0 is attacker

    #Stores X,Y of train and test sampels
    Ax_train=[]
    Ax_test=[]
    Ay_train=[]
    Ay_test=[]

    PLen=0 # Stores size of x_test
    x_train, x_test, y_train, y_test = train_test_split(Final, Y_out, test_size=0.1, random_state = 423, shuffle=True)

    A=np.arange(0.5,0.7,0.01) #vector of mu
    Menf=[] #Definitive array of means for input data depending on mu (A array)
    for i in range(len(A)):
        Mean=[]
        for k in range(len(x_test)):
    
            if (1-np.mean(x_test[k])<A[i]):
                Mean.append(0) #does not pass
            else:
                Mean.append(1) #passes

        Menf.append(Mean)
        PLen=len(x_test)
        Ax_train.append(x_train)
        Ax_test.append(x_test)
        Ay_train.append(y_train)
        Ay_test.append(y_test)



    return Ax_train, Ax_test, Ay_train, Ay_test ,Menf, PLen, A


# run the test harness for evaluating a model ##########################################################################################################
def run_test_harness(E,At):

    #Parameters
    sizextr=10      #input training size for string (input size is lambda, but you may divide lambda to 10)
    sizex=sizextr   #input testing size for string
    np.random.seed(42)

    print("Starting....")
    # load dataset
    f_test=[]
    f_test2=[]

    x_train, x_test, y_train, y_test, mean,Plen,A =Data_creation(sizextr,sizex,E,At)
    auxa=[]

    for k in range(1):
        for i in range(Plen):
            ft=y_test[k]
            auxa.append(ft[i][0])

    auxa2=[]

    ff_test=[]
    for k in range(len(A)):
        f_test=[]
        for i in range(len(mean[0])):
            if(mean[k][i]==auxa[i]):
                f_test.append(1)
            else:
                f_test.append(0)

        ff_test.append(f_test)

    Mina=[]
    SMina=[]
    MinaB=[]
    SMinaB=[]

    for k in range(len(A)):
        Mina.append(np.mean(ff_test[k]))
        SMina.append(statistics.stdev(ff_test[k]))


    vecf=[]
    vecf2=[]

    
    # define DNN model, increase the data size if you want meaningful results
    model = define_model(len(x_train[0][0]))
    # fit model
